import React from 'react'
import ExpenseItem from "./ExpenseItem";


const ExpensesList = props => {
    if (props.content.length > 0) {
        return(
            <p> No expenses on this year.</p>
        )
    }

    return (
        <ul>
            {props.content.map(item =>
                <ExpenseItem
                    key={item.id}
                    title={item.title}
                    amount={item.amount}
                    date={item.date} />
            )}
        </ul>
    )
}
export default ExpensesList
